func Test_totalHammingDistance(t *testing.T) {
	ast := assert.New(t)
	
	for _, tc := range tcs {
		fmt.Printf("~~%v~~\n", tc)
		ast.Equal(tc.ans, totalHammingDistance(tc.nums), ":%v", tc)
	}
}

func Benchmark_totalHammingDistance(b *testing.B) {
	for i := 0; i < b.N; i++ {
		for _, tc := range tcs {
			totalHammingDistance(tc.nums)
		}
	}
}
